import React from "react";

const Dropdown = () => {
  return (
    <div className="dropdown-menu">
      <ul>
        <li>Menu 1</li>
        <li>Menu 2</li>
        <li>Menu 3</li>
      </ul>
    </div>
  );
};

export default Dropdown;
